INSERT INTO `blog` VALUES ('2006-11-06 12:21:18', 10, 'Benvenuti in fantastik', 'Fantastik e'' una lega fantacalcistica composta da 8 squadre:<BR>\r\nAC Madda 13<BR>\r\nAFB<BR>\r\nAll Blacks<BR>\r\nCiurma United<BR>\r\nMesca<BR>\r\nPerla 18 FC<BR>\r\nReal 69<BR>\r\nSixty-Nine<BR>');
INSERT INTO `blog` VALUES ('2006-11-06 18:55:21', 10, 'Ripresa campionato', 'Dopo 3 turni di coppa riprende il campionato con Perla 18 FC e Sixty-Nine in vetta alla classifica con 15 punti.');
