INSERT INTO `blog` VALUES ('2006-12-21 15:52:10', 10, 'Fine primi due gironi', 'AFB campione d''inverno ma il campionato Ã¨ ancora equilibratissimo con tutte le squadre ancora in lizza per il titolo finale.\r\nLe prossime tre partite concluderanno la fase a gironi della coppa');
INSERT INTO `blog` VALUES ('2006-12-04 15:45:24', 1, '', 'Ho vinto ancora 4 !!!!');
INSERT INTO `blog` VALUES ('2006-12-22 17:05:47', 1, 'rimonta', 'dopo una sconfitta con sixtynine ho fattosei risultati utili consecutivi 4 vittorie e 2 pareggi!\r\n');
INSERT INTO `blog` VALUES ('2006-12-19 18:39:59', 10, 'Risultati', 'Sono stati aggiornati i risultati tenendo conto della partita rinviata');
INSERT INTO `blog` VALUES ('2007-01-13 10:30:08', 10, 'Ripresa campionato e calciomercato', 'Riprende il campionato, fino alla conclusione del calciomercato e al fantamercato le squadre resteranno le stesse.\r\nI giocatori trasferiti prenderanno comunque voto 6 per evitare che qualche squadra giochi in inferiorità numerica.');
INSERT INTO `blog` VALUES ('2007-01-13 10:36:36', 10, 'Calciomercato', 'Ecco una lista dei giocatori trasferiti per la serie A\r\n<A href=http://www.fantacalcio.kataweb.it/stat/index.php?page=calciomercato>Fantacalcio.kataweb</A><BR>E per fantastik\r\n<A HREF=http://fantastik.netsons.org/squadre.pdf>squadre.pdf</A>');
INSERT INTO `blog` VALUES ('2007-02-16 15:36:20', 5, 'E'' colpa del catania', 'Come al solito la sospensione del campionato mi ha fatto saltare un turno e al posto di affrontare Mesca alla 23^ giornata ho affrontato Perla, l''unico che ha fatto più punti di me!');
INSERT INTO `blog` VALUES ('2007-02-16 15:37:10', 10, 'Coppa', 'Il prossimo turno sarà la semifinale di coppa.');
INSERT INTO `blog` VALUES ('2007-03-08 11:58:11', 10, 'Finale di coppa', 'Le squadre qualificate sono AFB e All Blacks');
INSERT INTO `blog` VALUES ('2007-03-10 14:24:15', 1, 'non mollare mai', 'non devo mai mollare perchè ho 2 partite fondamentali per riaprire la lotta verso il titolo devo trapanare il perla 18 il pirata matteo credrci sempre arrendersi maiiiiiiiiiii!!!!!!!!!!');
INSERT INTO `blog` VALUES ('2007-03-10 18:34:32', 7, 'Coppa del cavolo', 'Se mi hai raggiunto è soltanto colpa della coppa!!!!quando c''è stata la semifinale a me hanno segnato ben 6 GIOCATORI,ma fortunato come sono non giocavo!!!se non ci credete andate a vedere!!!!!!!!!!!!!!\r\n\r\nForza rugby italia');
INSERT INTO `blog` VALUES ('2007-03-12 15:43:37', 1, '', 'anche io ho perso 2 a 0 cn il pelle senza avermi segnato nessuno invece nella giornata di coppa doppietta pandev bovo e budan!!!!!!!! per cosa poi per la coppa del nonno\r\n');
INSERT INTO `blog` VALUES ('2007-03-12 18:23:07', 7, 'Coppa del nonno al rogo', 'Scandaloso!!!!!!!!!!!!!!!!!!!!!!Quando gioco mi sengnano in tre però due li lascio in panchina talmente sono inculato!!!!!!!!!basta ne ho pieni i c......i!!!!!');
INSERT INTO `blog` VALUES ('2007-04-21 14:50:17', 5, 'Incredibile', 'Da quando in qua il turno infrasettimanale si fa al pomeriggio quando io sono in università e non posso mettere la formazione?\r\nPoi quanti bei gol che mi hanno rubato, a Caracciolo hanno tolto quello fatto nella giornata vera e poi non è entrato Gilardino.\r\nBen gli sta all''Italia che l''Europeo lo fanno in Polonia e Ucraina!');
INSERT INTO `blog` VALUES ('2007-04-23 17:38:14', 4, 'AFB', 'O VINTO LA COPPA DEL NONNO GELOSI????AHAHHAHAHAHAHH TROPPO FORTE\r\n');
INSERT INTO `blog` VALUES ('2007-05-28 16:32:31', 1, 'LA RIMONTA DA ULTIMO A TERZO', 'un buon terzo posto nn me lo aspettevo dopo lo schifo di inizio stagione!!!! 75 bruch wlf ciao ');
